import React from 'react';
import './ImageLinkForm.css';

const FaceRecognition = () => {
	return (
		<div className='center'>
		<img src={'https://samples.clarifai.com/face-det.jpg'}/>
		</div>
		);
}

export default ImageLinkForm;
